import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Nav from './components/Nav';
import Home from './components/Pages/Home';
import Principles from './components/Pages/Principles';
import './App.css';

class App extends Component {
  state = {
    principles: [
      {
        id:1,
        title: 'test principle 1'
      },
      {
        id:2,
        title: 'test principle 2'
      },
      {
        id:3,
        title: 'test principle 3'
      }
    ]
  }

  render() {
    return(
      <Router>
        <Nav />
        <Route path="/" componnent={Home} />
        <Route path="/principles" componnent={Principles} />
        <Principles principles={this.state.principles} />
      </Router>
    );
  }
}

export default App;
